import React, { Component } from 'react';
const SearchResults = props => {
    
    const displayResults = () => {
        const { results } = props;
        console.log(results);
        if(results === undefined){
            return (
                <React.Fragment>
                    
                </React.Fragment>
            )
        }
        if(props.showResults){
            let arrOfResults = [];
            results.map(match => {
                let symbol = match['1. symbol'];
                let name = match['2. name'];
                arrOfResults.push(
                    <tr>
                        <td>{symbol}</td>
                        <td>{name}</td>
                    </tr>
                )
            })
            let table = (
                <table>
                    <caption>Search Results for {props.term}</caption>
                    <tbody>
                        {arrOfResults}
                    </tbody>
                </table>
            );
            return table;
        }else{
            return (
                <React.Fragment>
                </React.Fragment>
            )
        }
    }

    return (
        <React.Fragment>
            {displayResults()}
        </React.Fragment>
    );
}
export default SearchResults;
